def nearestExit(maze, entrance):
    visited = set()
    visited.add(tuple(entrance))
    breadth_nodes = [entrance]
    child_height = 0
    while len(breadth_nodes) > 0:
        #print("Visited: {} | breadth_nodes: {}".format(visited, breadth_nodes))
        nodes_size = len(breadth_nodes)
        child_height += 1
        for _ in range(nodes_size):
            node_ = breadth_nodes.pop(0)
            if (0 in node_) or ((len(maze) - 1) == node_[0] or (len(maze[0]) - 1) == node_[1]):
                if node_ != entrance:
                    return child_height - 1
            
            # Look left 
            row = node_[0]
            col = node_[1] - 1
            if (row > -1 and row < len(maze)) and (col > -1 and col < len(maze[0])):
                if maze[row][col] == "." and tuple([row, col]) not in visited:
                    visited.add(tuple([row, col]))
                    breadth_nodes.append([row, col])
            
            # Look up
            row = node_[0] - 1
            col = node_[1]
            if (row > -1 and row < len(maze)) and (col > -1 and col < len(maze[0])):
                if maze[row][col] == "." and tuple([row, col]) not in visited:
                    visited.add(tuple([row, col]))
                    breadth_nodes.append([row, col])
            
            # Look right
            row = node_[0]
            col = node_[1] + 1
            if (row > -1 and row < len(maze)) and (col > -1 and col < len(maze[0])):
                if maze[row][col] == "." and tuple([row, col]) not in visited:
                    visited.add(tuple([row, col]))
                    breadth_nodes.append([row, col])
            
            # Look bottom
            row = node_[0] + 1
            col = node_[1] 
            if (row > -1 and row < len(maze)) and (col > -1 and col < len(maze[0])):
                if maze[row][col] == "." and tuple([row, col]) not in visited:
                    visited.add(tuple([row, col]))
                    breadth_nodes.append([row, col])
            
    return -1

